RECTED OR THAT THE SERVICE OR THE SERVER THAT MAKES THE SERVICE AVAILABLE IS FREE FROM ANY HARMFUL COMPONENTS, INCLUDING, WITHOUT LIMITATION, VIRUSES. WE DO NOT MAKE ANY REPRESENTATIONS OR WARRANTIES THAT THE INFORMATION (INCLUDING ANY INSTRUCTIONS) ON THE SERVICE IS ACCURATE, COMPLETE, OR USEFUL. YOU ACKNOWLEDGE THAT YOUR USE OF THE WEBSITE IS AT YOUR SOLE RISK. WE DO NOT WARRANT THAT YOUR USE OF THE WEBSITE IS LAWFUL IN ANY PARTICULAR JURISDICTION, AND WE SPECIFICALLY DISCLAIM SUCH WARRANTIES. SOME JURISDICTIONS LIMIT OR DO NOT ALLOW THE DISCLAIMER OF IMPLIED OR OTHER WARRANTIES SO THE ABOVE DISCLAIMER MAY NOT APPLY TO YOU TO THE EXTENT SUCH JURISDICTION\'S LAW IS APPLICABLE TO YOU AND THESE TERMS AND CONDITIONS.</p><p>\r\n            BY ACCESSING OR USING THE WEBSITE YOU REPRESENT AND WARRANT THAT YOUR ACTIVITIES ARE LAWFUL IN EVERY JURISDICTION WHERE YOU ACCESS OR USE THE SERVICE. WE DO NOT ENDORSE CONTENT AND SPECIFICALLY DISCLAIM ANY RESPONSIBILITY OR LIABILITY TO ANY PERSON OR ENTITY FOR ANY LOSS, DAMAGE (WHETHER ACTUAL, CONSEQUENTIAL, PUNITIVE OR OTHERWISE), INJURY, CLAIM, LIABILITY OR OTHER CAUSE OF ACTION OF ANY KIND OR CHARACTER BASED UPON OR RESULTING FROM ANY CONTENT.\r\n        </p>\r\n\r\n        <h3>INDEMNIFICATION:</h3>\r\n        <p>You and also any third party for or on behalf of whom you operate an account or activity on the website, agree to defend, indemnify and hold us harmless from and against any claims, liabilities, damages, losses and expenses, including, without limitation, reasonable legal and attorneys’ fees and costs, arising out of or in any way connected with any of the following:\r\n\r\n        <ul>\r\n            <li>Your uploads, access to or use of the website;</li>\r\n            <li>Your breach or alleged breach of these Terms and Conditions;</li>\r\n            <li>Your violation of any third-party right, including, without limitation, any intellectual property right, publicity, confidentiality, property, or privacy right;\r\n