 </p>\r\n\r\n        <h3>CONTACT INFORMATION:</h3>\r\n        <p>If you have any questions regarding these terms and conditions of this website, please contact us by any of the following means;</p><p>\r\n            <strong>Web:</strong> <a href=\"https://healmb.com\">www.healmb.com</a><br>\r\n            <strong>Email:</strong> <a href=mailto:info@healmb.com\">info@healmb.com</a><br>\r\n            <strong>Address:</strong> 1042 Center Dr, Richmond,KY 40475, USA.<br>\r\n            <strong>Contact:</strong> 859-353-7776<br>\r\n        </p>\r\n        <div class=\"copyrightclas\">\r\n            © All rights reserved.	<div class=\"datediv\">March, 2019.</div>\r\n        </div>\r\n', '2019-04-30 08:10:19'),
(42, 'Privacy Policy', '\r\n        <p>This Privacy Policy sets out how we, <a href=\"https://healmb.com\">www.healmb.com</a>, collect, store and use information about you when you use or interact with our website, <a href=\"https://healmb.com\">www.healmb.com</a> (our website) and where we otherwise obtain or collect information about you.<br>\r\n        This Privacy Policy is effective from 20th April 2019.</p>\r\n        <h3>OUR DETAILS:</h3>\r\n       <p> Heal Mind Body LLC (we, our and us) operates the website <a href=\"https://healmb.com\">www.healmb.com</a>.<br>\r\n        <a href=\"https://healmb.com\">www.healmb.com</a> is based in the United States. Our registered address is 1042 Center Dr, Richmond, KY 40475, USA.<br>\r\n        Our email address is info@healmb.com.</p>\r\n\r\n        <h3>INFORMATION COLLECTED BY US WHEN YOU CONTACT:</h3>\r\n        <p> We collect and use the following information from users who contact us in for any query.<br>\r\n            <br><strong>Email Address:</strong><br>\r\n        Whenever users send an email to info@healmb.com, we get the user\'s email address and any other information they provide in that email.\r\n            <br> <strong>Contact Form:</strong><br>\r\n        Whenever users contact us using our contact form available on our website, we collect their name, email address, and IP address. We also collect other information they provide us when they complete our contact form including but not limited to any optional information, such as phone number.\r\n            <br><strong>Mail:</strong><br>\r\n        If users contact us by emailing us on our mailing address, mentioned on our website, we may collect any information they provide us in any postal communications.\r\n        </p>\r\n        <h3> INFORMATION WE COLLECT WHEN USERS INTERACT ON OUR WEBSITE:</h3>\r\n        <p>\r\n\r\n        We may collect and use the following information from users who interact on our website.<br>\r\n            <strong>E-Newsletter:</strong><br>\r\n        We may process information that users provide to us for the purpose of subscribing to our E-newsletters. The data collected may be processed for the purposes of sending you the relevant newsletters.\r\n            <br><strong>Account Registration:</strong><br>\r\n        We may process users account data (\"account data\") whenever users register an account on our website. The account data may include your name, phone number, IP address and email address. The account data may be processed for the purposes of operating our website, providing our services, ensuring the security of our website and services, maintaining back-ups of our databases and communicating with you.\r\n        </p>\r\n        <h3>  INFORMATION WE COLLECT WHEN USERS PLACE ANY ORDER ON OUR WEBSITE:</h3>\r\n        <p>\r\n\r\n        We collect and use the following information from users whenever they place an order on <a href=\"https://healmb.com\">www.healmb.com</a>.\r\n            <br> <strong>Mandatory:</strong><br>\r\n        When users place an order for services on <a href=\"https://healmb.com\">www.healmb.com</a>, we may collect their name, email address, billing address, mailing address and any other mandatory information regarding our services.\r\n        If they do not provide us this information, they may not be able to purchase our services from <a href=\"https://healmb.com\">www.healmb.com</a>.\r\n            <br><strong> Optional:</strong><br>\r\n\r\n        We also collect optional information from users, such as their contact numbers and any other optional information when they place an order on our website. We may ask them for any marketing communications from us.\r\n            <br> <strong>Payment Processing:</strong><br>\r\n        When users place any order or purchase any service on our website they will need to make payment for their orders. In order to process payment, we use third-party services, all payment transaction shall be processed by the third party.\r\n        </p>\r\n\r\n        <h3>INFORMATION WE COLLECT FROM THIRD PARTIES:</h3>\r\n        <p>We may collect information about you such as your name and contact details and any other information from any third party. The third party from which we may receive information is generally included Google.</p>\r\n        <p>We can also get information about you from any third-party with whom we have had no prior contact.</p>\r\n        <p>In some cases, we may obtain information about users from publicly accessible sources such as from any online databases, directories, and social media websites.</p>\r\n\r\n        <h3>INFORMATION RECEIVED ABOUT YOU IN ERROR:</h3>\r\n        <p>In case we receive any information from any third-party about you in error we will not use such information and delete that information.</p>\r\n\r\n        <h3>INFORMATION SHARED BY US:</h3>\r\n        <p>We may share/disclose information about you to any third party for purposes which we use your information.\r\n            <br><strong>Information shared to service providers:</strong><br>\r\n        We also use third party services which are necessary to run our website and our business.\r\n        We may share your Information with our third-party service providers where it is necessary to share to provide you with the service, which may be essential for accessing the website or purchasing our services.\r\n            <br><strong>Information shared with other Third-Parties:</strong><br>\r\n        We may share your information with other third-parties in the following circumstances:\r\n            <br><strong>For information provided to other third parties such as Google Inc. and Apple:</strong>\r\n        Third-Parties such as Apple and Google Inc. collects data through our use of Google Analytics. They use this data, including IP addresses and other information, for multiple purposes, such as improvement of their services.\r\n        </p>\r\n\r\n        <h3>TRANSFER AND STORAGE OF INFORMATION:</h3>\r\n       <p>We may transfer your information with third-parties which is either related to the running of our website or where it is necessary for us to do so. These third-parties may include the parties set out below:\r\n       <ul>\r\n            <li>Third-Party Accountants</li>\r\n            <li>Third-Party Legal Advisors</li>\r\n            <li>Third-Party Business Affiliates</li>\r\n            <li>Third-Party Independent contractors</li>\r\n            <li>Third-Party Service Providers</li>\r\n        </ul>\r\n\r\n       </p>\r\n        <h3>DISCLOSE AND USE OF INFORMATION:</h3>\r\n        <p>In any circumstances we suspect that any criminal conduct has been occurred or may occur, in such circumstances we will contact to an authority, such as the police or Local Law Agencies. These circumstances include, where we suspect that any fraud or a cybercrime has been committed or received threats or any malicious content or communications to us or any third parties associated with us.</p>\r\n        <p>We can use the information of the user if we are involved in any dispute with users or any third party, we use such information to either resolve the dispute or as part of any arbitration, mediation or court resolution.</p>\r\n\r\n        <p>We will disclose and use information in order to comply with legal obligations, where we required.</p>\r\n\r\n        <h3>RETAINING YOUR INFORMATION:</h3>\r\n        <p>We have specific retention periods to retain your information where it is possible, and where is not possible, we have the following criteria to determine the retention periods.\r\n            <br><strong>Different Retention periods:</strong><br>\r\n            <br> <strong>Server log information:</strong><br>\r\n        We may retain your information on our server logs for one year.\r\n            <br>  <strong> Order information:</strong><br>\r\n        When users place an order for services on our website, we may retain such information for the period of six years following the end of the financial year, in which you place an order on our website, for our legal obligation to keep records for tax purpose.\r\n\r\n        </p>\r\n        <h3>CRITERIA FOR RETENTION PERIODS:</h3>\r\n\r\n        <p>In any other cases, we may retain your information for no longer than it is necessary, taking into account the following criteria:\r\n        <ul>\r\n            <li>For the purpose and use of information, now and in the future, whether it is necessary for us to continue to save such information in order to continue to perform our obligations or to contact you in the future;\r\n            </li>\r\n            <li> If we have any legal obligations to process user information;</li>\r\n            <li>If we have any legal basis to continue to process information;</li>\r\n            <li>For any relevant industry practices to retain any information;\r\n            </li>\r\n            <li>For the level of risk, cost and liability to hold the information;</li>\r\n            <li>How tough for us to confirm that such information can be kept safe and accurate; and\r\n            </li>\r\n            <li>Other relevant circumstances.</li>\r\n        </ul>\r\n        </p>\r\n\r\n        <h3>HOW WE SECURE YOUR INFORMATION:</h3>\r\n        <p>\r\n        We take appropriate measures to secure information and to protect from any unauthorized or misuse, accidental loss or destruction. We take the following measures to secure your information:\r\n        <ul>\r\n            <li>\r\n               Sharing and access to your information to relevant authorities, subject to confidentiality restrictions where it is necessary, and wherever it is possible;\r\n\r\n            </li>\r\n            <li>\r\n               Always using secure servers to store the information;\r\n\r\n            </li>\r\n            <li>\r\n               Cross check and verify the identity of any individual who demands access to your information prior to their access to your information;\r\n\r\n            </li>\r\n        </ul>\r\n        </p>\r\n        <h3>COMMUNICATION OF INFORMATION TO US THROUGH EMAIL:</h3>\r\n        <p>Communication of your information on the internet is not entirely safe, and in case you submit any information to us over the internet through email or any other way, you are entirely responsible and do that entirely on your own risk.</p>\r\n        <p>\r\n        We shall not be responsible for any loss, damage, expenses, loss of income, damage to reputation, liabilities or any other form of loss suffered by you in the result of the communication of information to us by email or by any mean.\r\n       </p>\r\n\r\n        <h3>YOUR RIGHTS:</h3>\r\n        <p>We have summarized the rights that you have under data protection law. You have the following rights in relation to your information, which you can exercise by sending an email to <a href=\"mailto:info@healmb.com\">info@healmb.com</a>:\r\n       <ul>\r\n            <li>The right to access, use and process of your information.</li>\r\n            <li>The right to rectification of your information;</li>\r\n            <li>The right to the erasure of your information;</li>\r\n            <li>The right to restrict processing of your information;</li>\r\n            <li>The right to object to the processing of your information;</li>\r\n            <li>The right to data portability of your information;</li>\r\n            <li>The right to complain to a supervisory authority; and</li>\r\n            <li>The right to withdraw your consent to process your information.</li>\r\n        </ul>\r\n\r\n        </p>\r\n        <h3>IDENTITY VERIFICATION WHERE YOU REQUEST TO ACCESS INFORMATION:</h3>\r\n        <p>We required you to verify your identity to request access to your information. We will be required by law to use some measures to verify your identity before your access to information.</p><p>\r\n        These measures are planned to protect your information from identity fraud, identity theft or general unauthorized use and access to the information by anyone else.</p><p>\r\n        We possess information about you on the system, we attempt to verify your identity using information from our system to secure access your access to your information.</p><p>\r\n        In some cases, it is not possible to confirm your identity from that information, or we have incomplete information, we may require original documentation or certified copies in order to verify your identity before we give access to you on your information.\r\n        </p>\r\n        <h3>YOUR RIGHT TO OBJECT TO OUR PROCESSING OF INFORMATION:</h3>\r\n       <p> You have the right to object to our processing of your personal information relating to your particular circumstances, only to the extent that the processing is necessary for the performance of any task carried out in the public interest or in the exercise of any authority vested in us or of the legitimate interests pursued by us or by any third party related to our services.\r\n        Users may exercise their right to object by:\r\n        <ul>\r\n\r\n            <li>Clicking the unsubscribe link on our website</li>\r\n            <li>Sending an email to us on <a href=\"mailto:info@healmb.com\">info@healmb.com</a></li>\r\n        </ul>\r\n\r\n       </p>\r\n        <h3>AMENDMENTS TO OUR PRIVACY POLICY:</h3>\r\n        <p> We may amend or update this privacy policy from time to time by publishing a new version on our website. You should check our website page occasionally to ensure your rights with any changes to this policy. We may or may not notify you of any changes to this policy by email or through the private messaging system on our website.\r\n            <br> <strong>Minor amendments to our Privacy Policy:</strong><br>\r\n        We may make minor modifications to our Policy. We update our Privacy Policy often with a new and effective date stated at the beginning and bottom of it. Your information will be processed by us under the practices set out in the updated and latest version of the Privacy Policy available on our website.\r\n            <br> <strong>Major amendments:</strong><br>\r\n        </p><p>We also make major amendments to our Policy or processor to use your information for any new purpose than the purpose for which we originally collected the information from you, we will notify you through your email available to us or by posting a notice on our website page.</p><p>\r\n        We will provide the information about any major amendments and their purposes and any other information which is necessary to share with you before we use such information for any different new purpose.</p><p>\r\n        We will obtain your prior consent before accessing, using your information for any different purpose from the purposes for which we originally collected your information from you.\r\n        </p>\r\n        <h3>CHILDREN’S POLICY:</h3>\r\n        <p>We do not contact or collect any information from children’s or persons under the age of 16. <a href=\"https://healmb.com\">www.healmb.com</a> is not intended to collect and solicit information from children and persons under the age of 16.</p><p>\r\n        It is possible that we may receive information from persons under the age of 16 by the error, fraud or deception of any third-party. Whenever we notice this or notified to us, by any user, as soon as we verify that, we will immediately obtain the parental consent to use the information or we will delete such\r\n\r\n        information from our servers whatever the circumstance are. For any information regarding underage person please contact immediately by emailing us at <a href=\"mailto:info@healmb.com\">info@healmb.com</a>.</p>\r\n\r\n        <h3>COPYRIGHTS:</h3>\r\n        <p>All the content in this Privacy Policy or on our website either owned by us or licensed to us and is protected by law around the world. All intellectual property rights in this Privacy Policy and on our website are reserved to <a href=\"https://healmb.com\">www.healmb.com</a>.\r\n        </p>\r\n        <h3>CONTACT INFORMATION:</h3>\r\n        <p>If you have any questions regarding these terms and conditions of this website, please contact us by any of the following means;<br>\r\n            <strong>Web:</strong> <a href=\"https://healmb.com\">www.healmb.com</a><br>\r\n            <strong>Email:</strong> <a href=\"mailto:info@healmb.com\">info@healmb.com</a><br>\r\n                <strong>Address:</strong> 1042 Center Dr, Richmond, KY 40475, USA.<br>\r\n                    <strong>Contact:</strong> 859-353-7776<br>\r\n        </p>\r\n\r\n        <div class=\"copyrightclas\">\r\n            © All rights reserved.	<div class=\"datediv\">March, 2019.</div>\r\n        </div>\r\n\r\n', '2019-04-30 08:07:16'),
