(25, 39, 'Introduction', '', NULL, 'Text', 'This diet and nutrition plan focuses on foods which assist with cleaning and detoxifying the body. The food choices and meals within this plan are centred round increasing your energy levels and vitality during your pregnancy. The aim of the plan is to enable you to eat healthily, giving you lots of food choices which whilst are healthy and will aid with detoxing, will also enable you to enjoy treat foods without feeling like you are on a strict diet. ', 0, 1),
(26, 39, 'Pregnancy Diet Plan - Document', 'Download this Word document with further details on your ideal pregnancy diet plan!', 'Diet_Plan_-_Pregnancy3.docx', 'Document', '', 0, 3),
(27, 39, 'The Importance of Pregnancy Diet and Exercise', '', NULL, 'Youtube Link', '3f_HS6fbK5M', 0, 2),
(28, 39, 'An Explanation of the Pregnancy Diet Plan', '', NULL, 'Youtube Link', 'lEUuL-6dbic', 0, 4),
(29, 36, 'Exercise Plan Guidance and Tips', '', NULL, 'Text', 'Please follow this guidance for all sessions during each of the three months <br>-For each session there are instructions for three sets of each exercise. This is to give you options. Depending on your previous and current exercise regime and experience you may find doing one set of each exercise per session is enough, or you may find you need to do two or even three sets of each. This is for you to decide, and also you may choose to begin with performing one set for each exercise for your first few sessions, before then increasing to two sets per exercise, and finally three sets.  <br>-The exercises I have selected for your workouts are mainly bodyweight exercises, meaning they work the full body, giving overall strength, and not straining any singular muscle groups.  <br>-Aim to complete between 2-6 sessions per week, depending on your availability, time constraints, fitness and stage of pregnancy.  <br>-All workouts and exercises are designed for you to be able to complete at home and with little or no equipment needed. ', 0, 2),
