(43, 30, 'Absolute Yoga - Checklist', 'Yoga is something different to most people. It’s quite diverse,\r\nand practitioners have different expectations when they start.\r\nThat’s perfectly okay. Whether your goal is greater\r\nenlightenment, a more toned and muscular body, or relief from\r\ndisease, there’s a yoga for you. This checklist will run you\r\nthrough the simple tips and techniques to become the better\r\nversion of yourself.', 'AY_Checklist1.pdf', 'Document', '', 0, 2),
