INSERT INTO `jg_tests` (`id`, `test_id`, `question_no`, `question`) VALUES
(1, 1, 1, 'How often have you been bothered by feeling down, depressed, irritable, or hopeless over the last two weeks?'),
(2, 1, 2, 'How often have you been bothered that you have little interest or pleasure in doing things over the last two weeks?'),
(3, 1, 3, 'How often have you been bothered by trouble falling asleep, staying asleep, or sleeping too much over the last two weeks?'),
(4, 1, 4, 'How often have you been bothered that you have poor appetite, weight loss, or overeating over the last two weeks?'),
(5, 1, 5, 'How often have you been bothered by feeling tired, or having little energy over the last two weeks?'),
(6, 1, 6, 'How often have you been bothered by feeling bad about yourself – or feeling that you are a failure, or that you have let yourself or your family down over the last two weeks?'),
(7, 1, 7, 'How often have you been bothered that you have trouble concentrating on things like school work, reading, or watching TV over the last two weeks?'),
(8, 1, 8, 'How often have you been bothered by moving or speaking so slowly that other people could have noticed? Or the opposite – being so fidgety or restless that you were moving around a lot more than usual over the last two weeks?'),
(9, 1, 9, 'How often have you been bothered by thoughts that you would be better off dead, or of hurting yourself in some way over the last two weeks?'),
(10, 2, 1, 'How often have you been bothered by feeling nervous, anxious or on edge over the last two weeks?'),
(11, 2, 2, 'How often have you been bothered by not being able to stop or control worrying over the last two weeks?'),
(12, 2, 3, 'How often have you been bothered by worrying too much about different things over the last two weeks?'),
(13, 2, 4, 'How often have you been bothered by having trouble relaxing over the last two weeks?'),
(14, 2, 5, 'How often have you been bothered by being so restless that it is hard to sit still over the last two weeks?'),
(15, 2, 6, 'How often have you been bothered by becoming easily annoyed or irritable over the last two weeks?'),
(16, 2, 7, 'How often have you been bothered by feeling afraid, as if something awful might happen over the last two weeks?'),
(30, 3, 4, 'Which of the following general life changes have occurred in in the last year? Select all that apply:'),
(29, 3, 3, 'Which of the following changes have occurred in your <strong> personal life</strong> in the last year? Select all that apply:'),
(28, 3, 2, 'Which of the following changes have occurred for you <strong>professionally/financially</strong> in the last year? Select all that apply:'),
(27, 3, 1, 'Which of the following changes have occurred in your <strong>family</strong> in the last year? Select all that apply:');
