INSERT INTO `jg_test_resultcontent` (`id`, `result_id`, `order_id`, `key`, `value`) VALUES
(1, 1, 1, 'paragraph', 'Your score falls into the low range. Some anxiety can be good – it can help us react to potential threats, perhaps by quickening our reflexes or focusing our attention, and it usually passes once the stressful situation has passed. Even though you might be feeling awful it looks like you’re having a normal reaction to a tough situation. You can do some things to help yourself feel a bit better.'),
(2, 1, 2, 'subheading', 'VIDEO (What is anxiety?) '),
(3, 1, 3, 'youtube', '<iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>'),
