(6, 1, 6, 'class_button', 'EXPLORE CLASSES'),
(7, 2, 1, 'paragraph', 'Your score shows you have some mild signs of anxiety. Maybe you’re in the middle of a stressful time, and your mind is responding to this. Chances are your anxiety will improve as time goes on, but it might be worth keeping an eye on how the anxiety’s impacting on your life.'),
(8, 2, 2, 'subheading', 'What is anxiety?'),
(9, 2, 3, 'youtube', '<iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>\r\n    '),
