(12, 2, 6, 'class_button', 'EXPLORE CLASSES'),
(13, 3, 1, 'paragraph', 'Your score suggests that anxiety has started to get in the way of how you live your daily life. Don’t be alarmed, this is very common and there are things you can do to improve your situation. There are different levels of anxiety and yours can change from day to day. But it’s important to seek help early. The sooner you talk to someone, the sooner you’ll be on the road to recovery.'),
(14, 3, 2, 'subheading', 'What is anxiety?'),
(15, 3, 3, 'youtube', ' <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>'),
